package com.neusoft.tdframework.admin.cache.data;

public class CachePerformanceObject {
	
	private String tableName;
	
	private String tableRecNum;
	
	private String tableSpeTime;

	public String getTableName() {
		return tableName;
	}

	public void setTableName(String tableName) {
		this.tableName = tableName;
	}

	public String getTableRecNum() {
		return tableRecNum;
	}

	public void setTableRecNum(String tableRecNum) {
		this.tableRecNum = tableRecNum;
	}

	public String getTableSpeTime() {
		return tableSpeTime;
	}

	public void setTableSpeTime(String tableSpeTime) {
		this.tableSpeTime = tableSpeTime;
	}

}
